import './App.css';
import React, { Component } from 'react';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      nome: 'Ricardo',
    };
  }
  render() {
    return;

    <div className="App">
      <header className="App-header">
        <div>{this.state.nome}</div>
      </header>
    </div>;
  }
}

export default App;
